import React from 'react'

export default function Sections() {

  return (
    <div class="button-container">
  <a href="https://example.com/page1" class="button">Legal rights</a>
  <a href="https://example.com/page2" class="button">Constitution</a>
  <a href="https://example.com/page3" class="button">Community forum</a>
  <a href="https://example.com/page4" class="button">History of cases</a>
</div>
  )

}
